import React, { Component } from "react";


class ArtistCoverPic extends Component {
  render() {
    return (
        <div className="slider-activation">
            {/* Start Single Slide */}
                    <div className="slide slide-style-2 d-flex align-items-center justify-content-center bg_image profile-cover-pic-artists" data-black-overlay="1">
                        <div className="container">
                            <div className="row">
                                <div className="col-lg-12">
                                    <div className="">
                                    
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>

            {/* End Single Slide */}
        </div>
    );
  }
}
export default ArtistCoverPic;
